import React from 'react';
import Hero from '../components/Hero';
import Content from '../components/Content'
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { Helmet } from 'react-helmet';
import './HomePage.css'
function HomePage(props) {

    return(
        <>
            <Hero title='Shreeya Chand' subTitle={props.subTitle} text={props.text} />
            <Content>
                <Row>
                    <Col>
                    <p>Hi! My name is Shreeya and I'm a high schooler in Maryland. 
                        I'm very interested in data and computer science as well as policy and politics.
                    </p>
                    </Col>
                    <Col>
                    <img src="https://yt3.ggpht.com/ytc/AAUvwni6F00T8VmdN0d4LBc855jJCJ_4d4hBFD6sg9_x=s900-c-k-c0x00ffffff-no-rj" alt="imgtest" width="100px"></img>
                    </Col>
                </Row>
            </Content>
            <Helmet>
                <title>Shreeya Chand</title>
            </Helmet>
        </>
    );

}

export default HomePage;
